							for (k7 = 0; k7 < 31; k7++) { 
								cnt = 0;
								for (j = 0; j < 800; j++) {
									newtxt[j] = (k1*txt[7 * j] + k2*txt[7 * j + 1] + k3*txt[7 * j + 2] + k4*txt[7 * j + 3] + k5*txt[7 * j + 4] + k6*txt[7 * j + 5] + k7*txt[7 * j + 6]) % 31;
									kol[newtxt[j]]++;
								}
								if (fabs(kol[14]) > idealKoef[14] - 10)
									for (j = 0; j < 31; j++)
										if (fabs(idealKoef[j] - kol[j]) < 10) cnt++;
								if (kol[14]>55 && kol[0]>40) printf("\n cnt %i KEY: %i %i %i %i %i %i %i\n", cnt, k1, k2, k3, k4, k5, k6, k7);
								if (cnt >= 20) {
									printf("\n!!!Success!!! cnt = %i\n KEY: %i %i %i %i %i %i %i\n", cnt, k1, k2, k3, k4, k5, k6, k7);
								}
								else {
									for (i = 0; i < 31; i++)
										kol[i] = 0;
								}
							}
	scanf_s("%i", i);
